properties.property:
this.properties["currentTask"] = 1;

this.triggerDialog = function(player, world, worldAdapter){
	var parent = this.parameters.generated_map.parent;
	var _this = this;

	function afterPopup(){
		++_this.properties["currentTask"];
		_this.triggerDialog(player, world, worldAdapter);
	}

	function openTask(){
		switch(_this.properties["currentTask"]){
			case 1:
				Crowd.updatePopup("alert2", afterPopup);
				break;
			case 2:
				Crowd.updatePopup(null, afterPopup);
				break;
			case 3:
				game.display.camera.addAction(new ArcCameraFadeOut(2000, function(camera){
					parent.load("empty", "MainStart");
				}, 0.0, 0.0, 0.0));
				return;
		}
	};

	this.TriggerDialog('MA_LIANG_' + this.properties["currentTask"], worldAdapter, player, openTask, 1, false);
}

var _this = this;
player.stop();
player.hasControl = false;

function afterQuestion(){
	world.getObject("StoryEvent").triggerDialog(player, world, worldAdapter);
}

world.triggers.removeChild(_this.name);
Crowd.updatePopup("question1", afterQuestion);
